export default async function addOptionToRemainingHorseListSelectElements({container:e,optionWithIndex:r}){try{const{option:o,index:t}=r;if(!o)throw new Error("No option provided.");e.querySelectorAll('select[id^="horse-list-"]').forEach((e=>{[...e.options].some((e=>e.value===o.value))||e.add(o.cloneNode(!0),t)}))}catch(e){const{AppError:r}=await import("../../../../../core/errors/models/AppError.min.js");r.handleError(e,{errorCode:r.Types.RENDER_ERROR,userMessage:"We encountered an error repopulating the horse list select element. Please refresh the page and start over.",displayTarget:"form-msg"})}}